import { Component } from "react";
import "tachyons";

class Card extends Component{
    render(){
        const { name, email, cardCSS } = this.props;
        return(
        <div className={cardCSS}>
            <h2>{name}</h2>
            <p>{email}</p>
        </div>
        )
    }
}
export default Card;
